import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class GeneralService {

  constructor(private http: HttpClient) { }

  GetTurnoItems() {
    return this.http.get(`/api/Turno/GetTurnoItems/`);
  }

  GetModalidadHorarioItems() {

    const data = this.http.get(`/api/General/Get_ModalidadHorarioItems/`);

    // data.forEach(value)

    // }
    let Contador: number = 0;
    data.forEach(function (value: any) {

      console.log(value[1].ModalidadHorarioId);
      Contador = Contador + 1;



    });

    data.forEach((element:) => {
      console.log(element[0].ModalidadHorarioId);
  });

    return data;
  }

  GetTipoHorarioItems() {
    return this.http.get(`/api/General/Get_TipoHorarioItems/`);
  }

  GeTipoSecuenciaMarcacionItems() {
    return this.http.get(`/api/General/GeTipoSecuenciaMarcacionItems/`);
  }
}
